import "./App.css";
import AddTodo from "./components/AddTodo";
import Header from "./components/Header";
import TodoData from "./components/TodoData";
import TodoList from "./components/TodoList";
import Timer from "./components/Timer";

function App() {
  return (
    <div className="App">
      <Header />
      <AddTodo />
      <TodoData />
      <TodoList />
      <Timer />
    </div>
  );
}
export default App;
